                  "{\"ACTIVITY\":[{\"ActivityID\":9,\"ActivityName\":\"CAMPING\",\"FacilityActivityDescription\":\"Camping\",\"FacilityActivityFeeDescription\":\"\",\"FacilityID\":\"232446\"}],\"CAMPSITE\":[],\"EVENT\":[],\"Enabled\":true,\"FACILITYADDRESS\":[{\"AddressCountryCode\":\"USA\",\"AddressStateCode\":\"CA\",\"City\":\"Yosemite
                  National Park \",\"FacilityAddressID\":\"20437806\",\"FacilityAddressType\":\"Default\",\"FacilityID\":\"232446\",\"FacilityStreetAddress1\":\"PO
                  BOX 577\",\"FacilityStreetAddress2\":\"\",\"FacilityStreetAddress3\":\"\",\"LastUpdatedDate\":\"2023-03-25\",\"PostalCode\":\"95389\"}],\"FacilityAdaAccess\":\"N\",\"FacilityDescription\":\"<h2>Overview</h2>\\n<p><strong>Wawona
                  Campground is currently closed due to extreme snow levels.</strong></p>\\n<p><strong>Wawona
                  Horse Campsites </strong>now have their own site for reservations: <a href=\\\"https://www.recreation.gov/camping/campgrounds/10220609\\\"
                  rel=\\\"nofollow\\\">https://www.recreation.gov/camping/campgrounds/10220609</a>\_</p>\\n<p>Wawona
                  campground sites are available to reserve up to five months in advance on
                  the 15th of each month at 7:00 a.m. PST. For example, on January 15, arrival
                  dates for the period May 15 to June 14 become available to reserve, and therefore,
                  the full arrival date window would be from the campground open date to June
                  14. \_</p>\\n<p><strong>Reservation Tips!</strong> Campsites in Yosemite are
                  extremely popular and typically sell out in minutes. Login to your account
                  or create a new account before the 7:00 a.m. (PST) release time. You may only
                  add reservations to your cart and proceed with your reservation if you are
                  logged into your account. The recreation.gov call center does NOT have access
                  to additional sites or additional information beyond what is published on
                  recreation.gov.\_</p>\\n<p><a href=\\\"https://recreationonestopprod.servicenowservices.com/external?id=kb_article&sys_id=72fff607dbe8a30022f970c08c961990&table=\\\"
                  rel=\\\"nofollow\\\">Yosemite National Park Campground Reservation Dates</a>\_</p>\\n<p>Wawona
                  Campground is located in breathtaking Yosemite National Park in Central California's
                  rugged Sierra Nevada Mountain Range. The site is situated at the southern
                  end of the park, 27 miles and approximately 45 minutes from Yosemite Valley,
                  at an elevation of 4000 feet.\_</p>\\n<p>Wawona was home to the park's headquarters
                  in 1904 and historic structures still stand today. The majestic Mariposa Grove
                  of Giant Sequoias is just a short drive away. Within Yosemite, visitors gaze
                  upon waterfalls, sheer granite cliffs, deep valleys, grand meadows, ancient
                  giant sequoias, a vast wilderness area and much more.</p>\\n<h2>Recreation</h2>\\n<p>Yosemite's
                  trails, cliffs, roads, and rivers provide endless recreational activities
                  for any kind of visitor. Hiking, biking, rock climbing, fishing, horseback
                  riding, rafting, auto touring, and photography are all very popular activities
                  within the park. <br><br><br>The Pioneer Yosemite History Center is like stepping
                  back in time. A visit to the Mariposa Grove of Giant Sequoias, just four miles
                  away, is a must-do. A network of hiking trails within the grove leads to stately
                  trees with names like Grizzly Giant, Faithful Couple, and California Tunnel
                  Tree.<br><br><br>Wawona offers several additional hiking trails, including
                  the Wawona Meadow Loop, Swinging Bridge Loop, Alder Creek and Chilnualna Falls.</p>\\n<h2>Facilities</h2>\\n<p>Wawona
                  Campground offers family, group, and horse campsites; reservations required.\_</p>\\n<p>Paved
                  roads and parking spurs, flush toilets and drinking water are provided. Each
                  campsite contains a picnic table, fire ring, and food storage locker. A general
                  store and gas station are located about a mile south of the campground.</p>\\n<h2>Natural
                  Features</h2>\\nThe area is forested with a diverse mix of ponderosa pine,
                  incense-cedar, white fir, and whiteleaf manzanita, which offers a pleasant
                  combination of sun and shade. The gentle South Fork of the Merced River flows
                  alongside the campground.\\n<h2>Nearby Attractions</h2>\\nJust 45 minutes
                  away is Yosemite Valley, an awe-inspiring landscape containing many of the
                  famous features for which Yosemite National Park is known. Hiking trails and
                  bike paths are abundant in the valley. Rafting the Merced River is a fun way
                  to cool down on a summer day when water levels are sufficient. Yosemite Valley
                  also offers numerous guided bus tours, educational programs, museums, ranger-led
                  activities, and an art center with workshops. \\n \\nA scenic 45-minute drive
                  leads to Glacier Point, with its sweeping views of Yosemite Valley, Little
                  Yosemite Valley, Half Dome, Vernal and Nevada Falls, and Clouds Rest, among
                  other notable landmarks.  \\n \\nThe Tioga Road, in the central region of
                  the park, offers a 39-mile scenic drive past forests, meadows, lakes, and
                  granite domes. Tuolumne Meadows embodies the high-country of the Sierra Nevada,
                  with its broad sub-alpine meadows and granite domes and peaks. Beautiful Hetch
                  Hetchy Reservoir is home to spectacular scenery and numerous wilderness trailheads.<h2>Charges
                  & Cancellations</h2>\\n<ul>\\n<li>Cancellation of individual or equestrian
                  site reservations will be charged a $10 service fee. If the cancellation is
                  within 48 hours of the arrival date, the first night's fee will also be charged.
                  Cancellations for a single night\u2019s use within 48 hours will <strong>not
                  </strong>receive a refund, but will not be assessed an additional service
                  fee.</li>\\n<li>Cancellation of a <strong>group</strong> site reservation
                  will incur a $10.00 service fee plus the first night\u2019s use fee when the
                  reservation is cancelled within 14 days of the scheduled arrival date.\_\_</li>\\n<li>No-shows
                  for any type of reservation will be charged a $20 service fee and the first
                  night's fee.</li>\\n</ul>\\n\",\"FacilityDirections\":\"<p>Take Highway 41
                  north from Fresno, Highway 140 east from Merced, or Highway 120 east from
                  Manteca into Yosemite National Park. Follow signs to Wawona. The campground
                  is located 8 miles north of the South Entrance station on Highway 41, and
                  27 miles south of  Yosemite Valley.</p>\\n\",\"FacilityEmail\":\"\",\"FacilityID\":\"232446\",\"FacilityLatitude\":37.5730556,\"FacilityLongitude\":-119.665,\"FacilityMapURL\":\"\",\"FacilityName\":\"Wawona
                  Campground\",\"FacilityPhone\":\"209-375-9535\",\"FacilityReservationURL\":\"\",\"FacilityTypeDescription\":\"Campground\",\"FacilityUseFeeDescription\":\"\",\"GEOJSON\":{\"COORDINATES\":[-119.665,37.5730556],\"TYPE\":\"Point\"},\"Keywords\":\"CG66,Wawona,Yosemite
